import React from 'react';
import './genderFilterPanel.css';

export default function GenderFilterPanel() {

    return (
        <div className="genderFilterSection">
            <div className="genderFilterHeaderDiv">
                <h2>Filter By Gender</h2>
            </div>
            <div className="genderFilterButtons">
                <label htmlFor="maleInput">Male</label>
                <input type="radio" name="genderSelector" id="maleInput"/>

                <label htmlFor="femaleInput">Female</label>
                <input type="radio" name="genderSelector" id="femaleInput"/>

                <button className="clearGenderFilterButton">Clear</button>
            </div>
        </div>
    )
}
